   "source": [
    "# Bellabeat Case Study\n",
    "\n",
    "## Introduction\n",
    "Bellabeat is a high-tech manufacturer of health-focused products for female users, including wellness trackers, Bellabeat app and membership. Bellabeat has been devoted to collecting data on activity, sleep, stress, and reproductive health to empower women with knowledge about their own health and habits. Bellabeat was founded by Urška Sršen in 2013 and has since grown rapidly and quickly, now with the possibility to become a greater player in the global smart device market.\n",
    "\n",
    "## *1. Ask:*\n",
    "\n",
    "## summary of the business task\n",
    "The purpose of this case study is to analyze the fitbit data and gain insight into how consumers use non-Bellabeat smart devices, in order to inform Bellabeat marketing strategy. \n",
    "## key stakeholders\n",
    "1. **Urška Sršen**: Bellabeat’s cofounder and Chief Creative Officer\n",
    "2. **Sando Mur**: Mathematician and Bellabeat’s cofounder; key member of the Bellabeat executive team\n",
    "3. **Bellabeat marketing analytics team**: A team of data analysts responsible for collecting, analyzing, and reporting data that helps guide Bellabeat’s marketing strategy.\n",
    "\n",
    "## *2. Prepare:*\n",
    "## Data Source\n",
    "The dataset used in this case study is FitBit Fitness Tracker Data from Kaggle. The dataset includes 18 sheets organized in long format covering fitbit user's sleeping habits, daily activities, sedentary duration and weight. As Bellabeat and FitBit share the same target market, this data is worthy analyzing to know better about the targeted customers. \n",
    "### ROCCC analysis\n",
    "**Reliability** : LOW – dataset has limited size of 30 users, whose gender is unknown. <br/>\n",
    "**Originality** : LOW – third party data collected with FitBit and stored in the public database <br/>\n",
    "**Comprehensive** : MEDIUM – dataset contains multiple fields on daily activity intensity, calories used, daily steps taken, daily sleep time and weight record.<br/>\n",
    "**Current** : MEDIUM – data is 6 years old, however the people's lifestyle did not change signifiantly. <br/>\n",
    "**Cited** : HIGH – data collector and source is well documented<br/>\n",
    "\n",
    "### Data selection\n",
    "Focus is on daily usage of the FitBit device and possible trends in FitBit device usage. Thus the following files from the dataset has been selected: <br/>\n",
    "* dailyActivity_merged.csv\n",
    "* dailyIntensities_merged.csv\n",
    "* sleepDay_merged.csv\n",
    "* weightLogInfo_merged.csv*"
   ]
  },
