   "source": [
    "# # Merging active & sleep dataframe\n",
    "sleep_df[,\"SleepDay\"] <- word(sleep_df[,\"SleepDay\"],1)\n",
    "active_sleep_df <- merge(active_df,sleep_df,by.x=c(\"Id\", \"ActivityDate\"), by.y=c(\"Id\", \"SleepDay\"))\n",
    "# # Get average total steps, active minutes, sedentary minutes and calories for each user\n",
    "active_summary <- aggregate(cbind(TotalSteps,VeryActiveMinutes,SedentaryMinutes,Calories)~Id,active_df,mean)\n",
    "active_summary[,2:5] <- round(active_summary[,2:5],0)\n",
    "colnames(active_summary)[2:5] <- c('avg_steps','avg_very_active_minutes','avg_sedentary_minutes','avg_calories')\n",
    "head(active_summary)\n",
    "\n",
    "# # Get average sleep hours for each user\n",
    "sleep_summary <- round(aggregate(total_hours_asleep~Id,sleep_df,mean),0)\n",
    "colnames(sleep_summary)[2] <- 'avg_sleep_hours'\n",
    "head(sleep_summary)\n",
    "\n",
    "# # Get average BMI for each user\n",
    "weight_summary <- aggregate(BMI~Id,weight_df,mean)\n",
    "head(weight_summary)\n",
    "\n",
    "# # Merging 3 summaries \n",
    "active_sleep_summary <- merge(active_summary,sleep_summary,by=\"Id\")\n",
    "active_sleep_BMI_summary <- merge(active_sleep_summary, weight_summary, by=\"Id\")\n"
   ]
  },
