   "source": [
    "ggplot(data=active_sleep_df,mapping=aes(x=SedentaryMinutes, y=total_hours_asleep)) +\n",
    "    geom_point(aes(color=total_hours_asleep))+\n",
    "    geom_smooth(method = lm, formula='y ~ x')+\n",
    "    scale_color_gradient(low=\"red\", high=\"blue\")+\n",
    "    labs(title= 'Sedentary Minutes vs Hours Asleep', \n",
    "       x = 'Sedentary Minutes', y = 'Hours Asleep', color = 'Hours Asleep')\n",
    "# # Correlation Coefficient.\n",
    "cor(active_sleep_df$SedentaryMinutes,\n",
    "    active_sleep_df$total_hours_asleep,\n",
    "    method=c(\"pearson\", \"kendall\", \"spearman\"))"
   ]
