   "source": [
    "ggplot(data=active_sleep_df,mapping=aes(x=VeryActiveMinutes, y=Calories)) +\n",
    "    geom_point(aes(color=Calories))+\n",
    "    geom_smooth(method = lm, formula='y ~ x')+\n",
    "    scale_color_gradient(low=\"red\", high=\"blue\")+\n",
    "    labs(title= 'Very Active Minutes vs Calories', \n",
    "       x = 'Very Active Minutes', y = 'Calories burned', color = 'Calories burned')\n",
    "# # Correlation Coefficient.\n",
    "cor(active_sleep_df$VeryActiveMinutes,\n",
    "    active_sleep_df$Calories,\n",
    "    method=c(\"pearson\", \"kendall\", \"spearman\"))"
   ]
