    "# # Draw a more detailed plot to show the correlation between Sedentary Minutes & Hours Asleep.\n",
    "ggplot(data=active_sleep_BMI_summary,mapping=aes(x=avg_steps,y=BMI))+geom_point(aes(color = BMI))+\n",
    "    geom_smooth(method = lm, formula='y ~ x')+\n",
    "    scale_color_gradient(low=\"red\", high=\"blue\")+\n",
    "    labs(title= \"Average Steps vs User's BMI\", \n",
    "       x = 'Average Steps', y = 'BMI', color = \"User's BMI\")\n",
    "\n",
    "# # Correlation Coefficient.\n",
    "cor(active_sleep_BMI_summary$avg_steps,\n",
    "    active_sleep_BMI_summary$BMI,\n",
    "    method=c(\"pearson\", \"kendall\", \"spearman\"))"
   ]
