    "## *6. Act:*\n",
    "### Conclusion: \n",
    "From the analysis result, it is clear that there is a trend in active people having a positive lifestyle. The three relations we found during the analysis includes:\n",
    "\n",
    "1. Sedentary duration has negative relation to sleep quality (hours asleep)\n",
    "2. Very-active minutes has a positive relation to calories burnt\n",
    "3. Users with more active time tend to walk more and burn more calories\n",
    "4. Active user is more likely to have a low BMI\n",
    "\n",
    "### Recommendations \n",
    "**Sleep** plays an important role in helping the body remain healthy and stave off diseases[1]. As woman care about health issues more than men[2], the targeted customers of BellaBeat would be interested in collecting and anaylizing their sleep data. BMI is also an essential indicator of body health. Overweight and obesity has become an increasing problem worldwide and can lead to many serious diseases and health conditions[3] The correlation between steps and BMI might be attractive to BellaBeat targeted customrs. Based on mentioned above, these change can be applied to make data-driven decisions on Bellabeat future products/functionality: \n",
    "\n",
    "1. Recommend users to walk at least 8,000 steps a day and enable alert notifications to encourage users to meet goal.\n",
    "2. Recommend users to get at least 7 hours of sleep a night and enable alert notifications to encourage users to meet this.\n",
    "3. Recommend users to log their weight info regularly to detect trends\n",
    "4. Enable notifications to encourage activity if a user has been sitting for too long.\n",
    "5. Create weekly fitness and wellness challenges to encourage use.\n",
    "6. Create weekly or monthly wellness reports to inform users of their performance and health status during the period.\n",
    "7. Give smart advices based on users' lifestyle.\n"
